import NewsCard from '../NewsCard/NewsCard'

function NewsCardList() {
    return (
        <ul className="card-list">
            <li><NewsCard /></li>
            <li><NewsCard /></li>
            <li><NewsCard /></li>
            <li><NewsCard /></li>
            <li><NewsCard /></li>
        </ul>
    );
}

export default NewsCardList;
